import React, {
  Component
} from "react";
import {
  HashRouter,
  Switch,
  Route,
  Redirect
} from "react-router-dom";
const login = asyncComponent(() => import("@/view/login/login"));
const sign = asyncComponent(() => import("@/view/sign/sign"));
const talk = asyncComponent(() => import("@/view/login/login"));
const friendList = asyncComponent(() => import("@/view/friendList/friendList"));

export default class RouteConfig extends Component {
  render() {
    return ( <
      HashRouter >
      <
      Switch >
      <
      Route path = "/login"
      component = {
        login
      }
      /> <
      Route path = "/sign"
      component = {
        sign
      }
      /> <
      Route path = "/friendList"
      component = {
        friendList
      }
      /> <
      Redirect exact from = "/"
      to = "/talk" / >
      <
      Route component = {
        talk
      }
      /> <
      /Switch> <
      /HashRouter>
    );
  }
}
